import { expect, describe, test } from "bun:test";
import { schemaValidations, validate } from "../validations/rules.ts";
import { TokenMetadata, ValidationContext, ValidationResult } from "../schema/types.ts";
import { mockTokenMetadata } from "./mocking.ts";

type TestVector = [string, ValidationContext, ValidationResult];

const context = (entry: TokenMetadata, filename?: string): ValidationContext => ({
  entry,
  filename: filename || entry.tokenId + ".json"
});

const success = (name: string): ValidationResult => ({ success: true, name });

const failure = (name: string, ...msgs: string[]): ValidationResult => ({
  success: false,
  name,
  errors: msgs.map((message) => ({ message }))
});

const filenameVectors: TestVector[] = [
  ["valid filename", context(mockTokenMetadata()), success("Filename matching")],
  [
    "invalid filename",
    context(
      mockTokenMetadata({
        tokenId: "8b08cdd5449a9592a9e79711d7d79249d7a03c535d17efaee83e216e80a44c4b"
      }),
      "invalid_name.json"
    ),
    failure(
      "Filename matching",
      "Expected 'invalid_name.json' to match '8b08cdd5449a9592a9e79711d7d79249d7a03c535d17efaee83e216e80a44c4b.json'."
    )
  ]
];

const logoVectors: TestVector[] = [
  [
    "valid svg logo",
    context(
      mockTokenMetadata({
        logo: "data:image/svg+xml;base64,"
      })
    ),
    success("Schema validation")
  ],
  [
    "valid png logo",
    context(
      mockTokenMetadata({
        logo: "data:image/png;base64,"
      })
    ),
    success("Schema validation")
  ],
  [
    "invalid png type",
    context(
      mockTokenMetadata({
        logo: "data:image/png;base64,"
      })
    ),
    failure(
      "Schema validation",
      "The logo Data URL Type is 'data:image/png;base64,' but the content is not a valid PNG image."
    )
  ],
  [
    "invalid svg type",
    context(
      mockTokenMetadata({
        logo: "data:image/svg+xml;base64,"
      })
    ),
    failure(
      "Schema validation",
      "The logo Data URL Type is 'data:image/svg+xml;base64,' but the content is not a valid SVG image."
    )
  ],
  [
    "no logo type",
    context(
      mockTokenMetadata({
        logo: ""
      })
    ),
    failure(
      "Schema validation",
      "The logo must be prefixed with either 'data:image/png;base64,' or 'data:image/svg+xml;base64,' according to the image type."
    )
  ],
  [
    "too big logo",
    context(
      mockTokenMetadata({
        logo: "data:image/png;base64,"
      })
    ),
    failure("Schema validation", "String must contain at most 87400 character(s)")
  ]
];

describe("well-formedness validation rules", () => {
  test.each(filenameVectors)("filename validation: %s case", (name, context, expected) => {
    const validationResult = validate(schemaValidations, context);
    const [fileNameCheck] = validationResult.results;
    expect(fileNameCheck).toMatchObject(expected);
  });

  test.each(logoVectors)("schema validation: %s case", (name, context, expectedResult) => {
    const validationResult = validate(schemaValidations, context);
    const [_, logoCheck] = validationResult.results;
    expect(logoCheck).toMatchObject(expectedResult);
  });
});
